import React from 'react'

const Card = (props) =>
{
     const { image, title, description, goto } = props;
    return (
        <div className='card'>
            <div className='card__img'>
                <img src={ image } alt={ title}/>
            </div>
            <div className='card__text'>   
                <h1 className='card__heading'>{ title}</h1>

                    {!!description && (
					<p className='card__paragraph'>{description}</p>
                ) }
                <a href={`${goto}`}></a>

            <div className='btn'> <button>button</button></div>
            </div>
        </div>
    )
}

export default Card
